template<typename T>
void deepCopyStructToDevice(MyStruct* d_struct, const MyStruct* h_struct) {
    // Copy the struct itself (shallow copy)
    cudaMemcpy(d_struct, h_struct, sizeof(MyStruct), cudaMemcpyHostToDevice);

    // For each pointer member, allocate device memory and copy data
    size_t data_size = h_struct->data_count * sizeof(T);
